"use strict";$.getUrlParam=function(e){var a=new RegExp("(^|&)"+e+"=([^&]*)(&|$)"),r=window.location.search.substr(1).match(a);return null!=r?decodeURI(r[2]):null};var username=$.getUrlParamUser("username");$.ajax({url:"/viewUser",data:{username:username},async:!0,cache:!1,type:"POST",dataType:"text",success:function(e){if(e){var a=JSON.parse(e)[0],r=a.id,s=a.username,t=a.password;$("#id").html(r),$("#username").html(s),$("#password").html(t)}else alert("数据传输有错误！")}});